import {
  SOCIAL_LOGIN_INITIATED,
  SOCIAL_LOGIN_SUCCESS,
} from './types';

export const socialLoginInitiated = (value) => ({
  type: SOCIAL_LOGIN_INITIATED,
  payload: value,
});


export const socialLoginSuccess = () => ({
  type: SOCIAL_LOGIN_SUCCESS,
});
